import React from "react";
import {Redirect} from "react-router-dom";

const Contact = (props: any)=> {

	const contact:any = () => {
    if (props.Pattern.state.profile.logged) {
      return(
        <div></div>
      )
    }else{
      return(
        <Redirect to="/login"></Redirect>
      )
    }
  }

	return(
		<div className="aboutContain">
			<div className = "aboutContainer">
				<div className = "aboutText">
					Here you can ask us anything,
					you can ask us what you want about the video game, 
					about the page, about us, who we are, what you want.
				</div><br/><br/><hr/><br/>
				<form>
					<div style={{width: "80%", margin: "auto"}}>
						<textarea className="messageContact" placeholder="Write your message"/>
						<button type="submit" className="buttonContact">Send message</button>
					</div>
				</form>
			</div>
			{contact()}
		</div>
	)
}

export default Contact;
